import React, {useState, useEffect} from 'react'

const AttributeList = ({select, showName}) => {
    const [selected, setSelected] = useState(null)
    useEffect(() => {
        select(selected);
    }, [selected])

    return (
        <div className="dropdown_filter_list">
            <select className="filter_dropdown_list" name="filters" id="filters" onChange={(e) => {setSelected(e.target.value)}}>
                showName?<option value="name">Alphabetical</option>:{null}
                <option value="str_strt">Starting Strength</option>
                <option value="agi_strt">Starting Agility</option>
                <option value="int_strt">Starting Intelligence</option>
                <option value="str_gain">Strength Gain</option>
                <option value="agi_gain">Agility Gain</option>
                <option value="int_gain">Intelligence Gain</option>
                <option value="move_spd">Move Speed</option>
                <option value="base_hp">Starting HP</option>
                <option value="base_mana">Starting Mana</option>
                <option value="hp_regen">HP Regen</option>
                <option value="mana_regen">Mana Regen</option>
                <option value="armor">Base Armor</option>
                <option value="BAT">Base Attack Time</option>
                <option value="atck_range">Attack Range</option>
                <option value="projectile_spd">Projectile Speed</option>
            </select>
        </div>
    )
}

export default AttributeList
